import styled from 'styled-components';

export const Container = styled.div`

    background-color: #F3F1F1;
    width: 100%;


.productList{
    width: 100%;
    display: grid;
    grid-template-columns: auto auto auto auto;
    gap: 24px;
    list-style: none;
    padding: 0px ;
    margin: 0 auto;
}

.productItem{
    display: inline-grid;
}
`;
